import React from "react";
import Header from "./components/nav/header.js";

import { BrowserRouter as Router, Route, Switch, Redirect } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Switch>

          {/* Default Route - Redirect to Home */}
          <Route exact path="/">
            <Redirect to="/home" />
          </Route> 
        </Switch>
      </div>
    </Router>
  );
}

export default App;
